query:
mutation sandboxDeleteReport ( $accountId:ID! $deleteReportInput:DeleteReportInput!) {
	sandbox ( accountId:$accountId ) {
		deleteReport ( input:$deleteReportInput  )  {
fileHash {
	enabled
	rules {
		properties
		audit {
			updatedTime
			updatedBy
		}
		rule {
			id
			name
			description
			index
			enabled
			fileName
			expirationDate
			action
			sha256
			section {
				id
				name
				subPolicyId
			}
		}
	}
	sections {
		properties
		audit {
			updatedTime
			updatedBy
		}
		section {
			id
			name
			subPolicyId
		}
		access {
			action
		}
	}
	audit {
		publishedTime
		publishedBy
	}
	revision {
		id
		name
		description
		changes
		createdTime
		updatedTime
	}
}
		}
	}	
}
